// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

contract WalletAuthority {
    event TransferAuthority(address newAuthority);
    event AddOwner(address newOwner);
    event RemoveOwner(address owner);

    address public walletAuthority;
    uint256 public numberOfOwners;
    mapping(address => bool) isOwner;
    uint256 public confirmationsRequired;
    uint256 public maxBlockLength;

    modifier onlyAuthority() {
        require(msg.sender == walletAuthority, "Only Authority");
        _;
    }

    function transferAuthority(address _newAuthority) public onlyAuthority {
        walletAuthority = _newAuthority;
        emit TransferAuthority(_newAuthority);
    }

    function addOwner(address _newOwner) public onlyAuthority {
        require(_newOwner != address(0), "Invalid Address");
        require(!isOwner[_newOwner], "Already a Owner");
        isOwner[_newOwner] = true;
        numberOfOwners += 1;
        newConfirmationsRequired();
        emit AddOwner(_newOwner);
    }

    function setMaxBlockLength(uint256 _newBlockLength) public onlyAuthority {
        maxBlockLength = _newBlockLength;
    }

    function removeOwner(address _owner) public onlyAuthority {
        require(_owner != address(0), "Invalid Address");
        require(isOwner[_owner], "Not an Owner");
        isOwner[_owner] = false;
        numberOfOwners -= 1;
        newConfirmationsRequired();
        emit RemoveOwner(_owner);
    }

    function newConfirmationsRequired() internal {
        confirmationsRequired = uint256((numberOfOwners * 6) / 10);
    }
}
